import React, { useState } from 'react'

// components
import FunctionUI from '../components/FunctionUI';
import Nav from './../components/Nav';
import About from './../components/About';
import List from './../components/List'

const Portfolio = ({ }) => {

    const [display, setDisplay] = useState(false);
    const [active, setActive] = useState(false);
    const data = "english"

    if (display) {
        return (
            <FunctionUI
                leng={data}
                setDisplay={setDisplay}
                display={display}
            />
        )
    } else {
        return <>
            <Nav
                active={active}
                setActive={setActive}
                setDisplay={setDisplay}
            />
            {active ? <List
                leng={data}
                setActive={setActive}
            /> :
                <>
                    <About leng={data} />
                    <a href='https://photos.google.com/share/AF1QipOXC48dgAXYRuJ6OD3QcA0nCEskdS6wfWlaUE3BTgWDTNRu5wEdBueS0mbtrqc9yw?key=amRGbS1LWW11Nmt1S1VXc3JOV1kwTHplTy1DUG5B&source=ctrlq.org'>
                        <img src='https://lh3.googleusercontent.com/pfFZDir8hLxwChTQT3o6Rc2M5D5msMM7BihnmDecSaVn9qSEzOEpS1KLocFiiBn8wIXQr0Sc4XK24o2eIGPcW34o0EjYleVkSNX2NgxUlp8lgWP3AtAcsF6TcWNgGc3xGGePJy2j=w2400' />
                        </a>
                    <img
                        src="https://lh3.googleusercontent.com/pfFZDir8hLxwChTQT3o6Rc2M5D5msMM7BihnmDecSaVn9qSEzOEpS1KLocFiiBn8wIXQr0Sc4XK24o2eIGPcW34o0EjYleVkSNX2NgxUlp8lgWP3AtAcsF6TcWNgGc3xGGePJy2j=w2400"
                        style={{
                            //    backgroundImage = `url('https://doc-0c-7c-docs.googleusercontent.com/docs/securesc/b297td4j68njuporrr0ghq1qgjfskc2q/riee0ijllg2pp5ks94goca6ivhipp0lm/1584093375000/02675452433170903306/02675452433170903306/0B0pnOXpjk8ZRWGE5ZE45c3ZJTWc?e=view&authuser=0&nonce=9s5lunb02n5aq&user=02675452433170903306&hash=iebn1cf1956g4cgof1ov79n1d3dcjutv')`,
                            height: "200px",
                            width: "200px"
                        }}
                    />
                </>}
        </>
    }
}

export default Portfolio;
